import React, { useEffect, useState, useRef } from 'react';

const SearchSection = ({ filters = {}, onChange = () => {} }) => {
  const [classificationOpen, setClassificationOpen] = useState(false);
  const [priceRangeOpen, setPriceRangeOpen] = useState(false);
  const [locationModalOpen, setLocationModalOpen] = useState(false);
  const [selectedClassification, setSelectedClassification] = useState(filters.type || '');
  const [selectedLocation, setSelectedLocation] = useState(filters.location || '');
  const [minPrice, setMinPrice] = useState(filters.min_price || '');
  const [maxPrice, setMaxPrice] = useState(filters.max_price || '');
  const [searchQuery, setSearchQuery] = useState(filters.search || '');

  // Use backend enum values with human labels
  const classifications = [
    { value: '', label: 'All Types' },
    { value: 'bed_space', label: 'Bed Space' },
    { value: 'dormitory', label: 'Dormitory' },
    { value: 'boarding_house', label: 'Boarding House' },
    { value: 'studio_apartment', label: 'Studio Apartment' },
    { value: 'room_for_rent', label: 'Room for Rent' }
  ];

  // Location options
  const locations = [
    { value: '', label: 'All Locations' },
    { value: 'cebu_city', label: 'Cebu City' },
    { value: 'mandaue', label: 'Mandaue City' },
    { value: 'lapu_lapu', label: 'Lapu-Lapu City' },
    { value: 'talisay', label: 'Talisay City' },
    { value: 'consolacion', label: 'Consolacion' },
    { value: 'minglanilla', label: 'Minglanilla' }
  ];

  const toggleClassification = () => {
    setClassificationOpen(!classificationOpen);
    setPriceRangeOpen(false);
  };

  const togglePriceRange = () => {
    setPriceRangeOpen(!priceRangeOpen);
    setClassificationOpen(false);
  };

  const openLocationModal = () => {
    setLocationModalOpen(true);
    setClassificationOpen(false);
    setPriceRangeOpen(false);
  };

  const handleSearchChange = (e) => {
    setSearchQuery(e.target.value);
  };

  const handleClassificationSelect = (classification) => {
    setSelectedClassification(classification);
    setClassificationOpen(false);
    onChange({ ...filters, type: classification });
  };

  const handleLocationSelect = (location, locationName) => {
    setSelectedLocation(locationName || location);
    setLocationModalOpen(false);
    onChange({ ...filters, location: location, locationName: locationName });
  };

  // Initialize map when modal opens
  const initializeMap = () => {
    if (mapRef.current && !map) {
      // Create map using a simple implementation (we'll use a Google Maps-like interface)
      const mapInstance = {
        center: mapCenter,
        zoom: 13,
        onClick: (lat, lng) => {
          setSelectedCoordinates([lat, lng]);
          setMapCenter([lat, lng]);
          // Update marker position
          if (marker) {
            marker.setPosition([lat, lng]);
          }
        }
      };
      setMap(mapInstance);
    }
  };

  const getCurrentLocation = () => {
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        (position) => {
          const { latitude, longitude } = position.coords;
          const coords = [latitude, longitude];
          setSelectedCoordinates(coords);
          setMapCenter(coords);
          
          // Update map center if map is initialized
          if (map) {
            map.center = coords;
          }
          
          const locationString = `${latitude.toFixed(4)}, ${longitude.toFixed(4)}`;
          handleLocationSelect(`${latitude},${longitude}`, `Current Location (${locationString})`);
        },
        (error) => {
          console.error('Error getting location:', error);
          alert('Unable to get your current location. Please select a location manually.');
        }
      );
    } else {
      alert('Geolocation is not supported by this browser.');
    }
  };

  const handleMapClick = (lat, lng) => {
    const coords = [lat, lng];
    setSelectedCoordinates(coords);
    setMapCenter(coords);
    
    const locationString = `${lat.toFixed(4)}, ${lng.toFixed(4)}`;
    // Don't close modal immediately, let user confirm
  };

  const confirmMapLocation = () => {
    if (selectedCoordinates) {
      const [lat, lng] = selectedCoordinates;
      const locationString = `${lat.toFixed(4)}, ${lng.toFixed(4)}`;
      handleLocationSelect(`${lat},${lng}`, `Selected Location (${locationString})`);
    }
  };

  // Get predefined coordinates for known locations
  const getLocationCoordinates = (locationValue) => {
    const locationCoords = {
      'cebu_city': [10.3157, 123.8854],
      'mandaue': [10.3237, 123.9227],
      'lapu_lapu': [10.3103, 123.9494],
      'talisay': [10.2449, 123.8492],
      'consolacion': [10.3817, 123.9572],
      'minglanilla': [10.2446, 123.7956]
    };
    return locationCoords[locationValue] || [10.3157, 123.8854]; // Default to Cebu City
  };

  const handleApplyPriceRange = () => {
    setPriceRangeOpen(false);
    onChange({ ...filters, min_price: minPrice, max_price: maxPrice });
  };

  const handleClearFilters = () => {
    setSelectedClassification('');
    setSelectedLocation('');
    setMinPrice('');
    setMaxPrice('');
    setSearchQuery('');
    onChange({ search: '', type: '', location: '', min_price: '', max_price: '' });
  };

  // Debounce search changes to avoid chatty requests
  useEffect(() => {
    const id = setTimeout(() => {
      onChange({ ...filters, search: searchQuery });
    }, 300);
    return () => clearTimeout(id);
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [searchQuery]);

  const getSelectedClassificationLabel = () => {
    const selected = classifications.find(c => c.value === selectedClassification);
    return selected ? selected.label : 'All Types';
  };


  const hasActiveFilters = selectedClassification || selectedLocation || minPrice || maxPrice || searchQuery;

  return (
    <div className="bg-gradient-to-r from-gray-50 to-white border border-gray-200 rounded-2xl p-6 mb-8 shadow-sm">

      {/* Main Search Bar */}
      <div className="mb-6">
        <div className="relative">
          <div className="absolute inset-y-0 left-0 pl-4 flex items-center pointer-events-none">
            <svg className="h-6 w-6 text-gray-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z" />
            </svg>
          </div>
          <input
            type="text"
            placeholder="Search by location, property name, amenities, or any keyword..."
            value={searchQuery}
            onChange={handleSearchChange}
            className="block w-full pl-12 pr-4 py-4 text-lg border-2 border-gray-200 rounded-xl focus:outline-none focus:ring-2 focus:ring-black focus:border-black transition-all duration-200 bg-white shadow-sm"
          />
        </div>
      </div>

      {/* Filters Row - Single Line Layout */}
      <div className="flex items-center gap-3 mb-4 overflow-x-auto">
        {/* Classification Filter */}
        <div className="relative flex-shrink-0">
          <button 
            onClick={toggleClassification}
            className={`flex items-center space-x-2 px-4 py-2 border-2 rounded-lg transition-all duration-200 font-medium whitespace-nowrap ${
              selectedClassification 
                ? 'border-black bg-black text-white shadow-lg' 
                : 'border-gray-200 hover:border-gray-300 bg-white text-gray-700 hover:bg-gray-50'
            }`}
          >
            <svg className="h-4 w-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 21V5a2 2 0 00-2-2H7a2 2 0 00-2 2v16m14 0h2m-2 0h-5m-9 0H3m2 0h5M9 7h1m-1 4h1m4-4h1m-1 4h1m-5 10v-5a1 1 0 011-1h2a1 1 0 011 1v5m-4 0h4" />
            </svg>
            <span>{getSelectedClassificationLabel()}</span>
            <svg className={`w-4 h-4 transition-transform duration-200 ${classificationOpen ? 'rotate-180' : ''}`} fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 9l-7 7-7-7" />
            </svg>
          </button>

          {/* Classification Dropdown */}
          {classificationOpen && (
            <div className="absolute top-full left-0 mt-2 w-full sm:w-72 bg-white border-2 border-black rounded-xl shadow-2xl z-50 overflow-hidden">
              <div className="p-2">
                <div className="text-xs font-semibold text-gray-500 mb-3 px-3 uppercase tracking-wide">Property Type</div>
                <div className="space-y-1">
                  {classifications.map((c) => (
                    <button
                      key={c.value}
                      onClick={() => handleClassificationSelect(c.value)}
                      className={`w-full text-left px-4 py-3 text-sm font-medium rounded-lg transition-all duration-150 ${
                        selectedClassification === c.value 
                          ? 'bg-black text-white shadow-sm' 
                          : 'text-gray-700 hover:bg-gray-100'
                      }`}
                    >
                      {c.label}
                    </button>
                  ))}
                </div>
              </div>
            </div>
          )}
        </div>

        {/* Location Filter */}
        <div className="relative flex-shrink-0">
          <button 
            onClick={openLocationModal}
            className={`flex items-center space-x-2 px-4 py-2 border-2 rounded-lg transition-all duration-200 font-medium whitespace-nowrap ${
              selectedLocation 
                ? 'border-black bg-black text-white shadow-lg' 
                : 'border-gray-200 hover:border-gray-300 bg-white text-gray-700 hover:bg-gray-50'
            }`}
          >
            <svg className="h-4 w-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M17.657 16.657L13.414 20.9a1.998 1.998 0 01-2.827 0l-4.244-4.243a8 8 0 1111.314 0z" />
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 11a3 3 0 11-6 0 3 3 0 016 0z" />
            </svg>
            <span>{selectedLocation || 'Location'}</span>
          </button>
        </div>

        {/* Price Range Filter */}
        <div className="relative flex-shrink-0">
          <button 
            onClick={togglePriceRange}
            className={`flex items-center space-x-2 px-4 py-2 border-2 rounded-lg transition-all duration-200 font-medium whitespace-nowrap ${
              (minPrice || maxPrice)
                ? 'border-black bg-black text-white shadow-lg' 
                : 'border-gray-200 hover:border-gray-300 bg-white text-gray-700 hover:bg-gray-50'
            }`}
          >
            <svg className="h-4 w-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 8c-1.657 0-3 .895-3 2s1.343 2 3 2 3 .895 3 2-1.343 2-3 2m0-8c1.11 0 2.08.402 2.599 1M12 8V7m0 1v8m0 0v1m0-1c-1.11 0-2.08-.402-2.599-1" />
            </svg>
            <span>
              {(minPrice || maxPrice) 
                ? `₱${minPrice || '0'} - ₱${maxPrice || '∞'}` 
                : 'Price Range'
              }
            </span>
            <svg className={`w-4 h-4 transition-transform duration-200 ${priceRangeOpen ? 'rotate-180' : ''}`} fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 9l-7 7-7-7" />
            </svg>
          </button>

          {/* Price Range Dropdown */}
          {priceRangeOpen && (
            <div className="absolute top-full left-0 mt-2 w-full sm:w-80 bg-white border-2 border-black rounded-xl shadow-2xl z-50">
              <div className="p-6">
                <div className="text-xs font-semibold text-gray-500 mb-4 uppercase tracking-wide">Price Range (₱)</div>
                
                {/* Min Price */}
                <div className="mb-4">
                  <label className="block text-sm font-semibold text-gray-700 mb-2">Minimum Price</label>
                  <input
                    type="number"
                    value={minPrice}
                    onChange={(e) => setMinPrice(e.target.value)}
                    placeholder="0"
                    className="w-full px-4 py-3 border-2 border-gray-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-black focus:border-black transition-all duration-200"
                  />
                </div>

                {/* Max Price */}
                <div className="mb-6">
                  <label className="block text-sm font-semibold text-gray-700 mb-2">Maximum Price</label>
                  <input
                    type="number"
                    value={maxPrice}
                    onChange={(e) => setMaxPrice(e.target.value)}
                    placeholder="10000"
                    className="w-full px-4 py-3 border-2 border-gray-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-black focus:border-black transition-all duration-200"
                  />
                </div>

                {/* Apply Button */}
                <button
                  onClick={handleApplyPriceRange}
                  className="w-full bg-black text-white py-3 px-4 rounded-lg font-semibold hover:bg-gray-800 transition-all duration-200 shadow-sm"
                >
                  Apply Price Range
                </button>
              </div>
            </div>
          )}
        </div>

        {/* Clear Filters Button */}
        {hasActiveFilters && (
          <button
            onClick={handleClearFilters}
            className="flex items-center space-x-2 px-4 py-2 text-gray-600 hover:text-gray-800 hover:bg-gray-100 rounded-lg transition-all duration-200 font-medium flex-shrink-0"
          >
            <svg className="h-4 w-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" />
            </svg>
            <span>Clear All</span>
          </button>
        )}
      </div>

      {/* Active Filters Display */}
      {hasActiveFilters && (
        <div className="flex flex-wrap gap-2">
          {searchQuery && (
            <span className="inline-flex items-center px-3 py-1 rounded-full text-xs font-medium bg-black text-white">
              Search: "{searchQuery}"
            </span>
          )}
          {selectedClassification && (
            <span className="inline-flex items-center px-3 py-1 rounded-full text-xs font-medium bg-black text-white">
              {getSelectedClassificationLabel()}
            </span>
          )}
          {selectedLocation && (
            <span className="inline-flex items-center px-3 py-1 rounded-full text-xs font-medium bg-black text-white">
              {selectedLocation}
            </span>
          )}
          {(minPrice || maxPrice) && (
            <span className="inline-flex items-center px-3 py-1 rounded-full text-xs font-medium bg-black text-white">
              ₱{minPrice || '0'} - ₱{maxPrice || '∞'}
            </span>
          )}
        </div>
      )}

      {/* Interactive Map Location Modal */}
      {locationModalOpen && (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50 p-4">
          <div className="bg-white rounded-2xl w-full max-w-4xl mx-auto shadow-2xl max-h-[90vh] overflow-hidden">
            {/* Modal Header */}
            <div className="flex items-center justify-between p-4 border-b border-gray-200 bg-white">
              <div className="flex items-center space-x-3">
                <svg className="h-6 w-6 text-blue-600" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M17.657 16.657L13.414 20.9a1.998 1.998 0 01-2.827 0l-4.244-4.243a8 8 0 1111.314 0z" />
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 11a3 3 0 11-6 0 3 3 0 016 0z" />
                </svg>
                <h3 className="text-xl font-bold text-gray-900">Select Location on Map</h3>
              </div>
              <button
                onClick={() => setLocationModalOpen(false)}
                className="text-gray-400 hover:text-gray-600 transition-colors p-2 hover:bg-gray-100 rounded-lg"
              >
                <svg className="h-6 w-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" />
                </svg>
              </button>
            </div>

            {/* Map Container */}
            <div className="relative">
              {/* Interactive Accurate Cebu Map */}
              <div 
                ref={mapRef}
                className="w-full h-96 relative overflow-hidden cursor-crosshair border-2 border-gray-300"
                onClick={(e) => {
                  const rect = e.currentTarget.getBoundingClientRect();
                  const x = e.clientX - rect.left;
                  const y = e.clientY - rect.top;
                  
                  // Convert pixel coordinates to lat/lng (more accurate for Cebu)
                  const lat = 10.35 + (rect.height/2 - y) * 0.0008;
                  const lng = 123.85 + (x - rect.width/2) * 0.001;
                  
                  handleMapClick(lat, lng);
                }}
                style={{
                  backgroundColor: '#e6f3ff',
                  backgroundImage: `
                    radial-gradient(ellipse at 85% 15%, rgba(59, 130, 246, 0.3) 0%, transparent 40%),
                    radial-gradient(ellipse at 15% 85%, rgba(59, 130, 246, 0.2) 0%, transparent 50%),
                    linear-gradient(135deg, rgba(34, 197, 94, 0.1) 0%, rgba(251, 191, 36, 0.05) 100%)
                  `
                }}
              >
                {/* Geographically Accurate Cebu City Map */}
                <div className="absolute inset-0">
                  
                  {/* Cebu Island Land Mass - Accurate North-South Orientation */}
                  <div 
                    className="absolute inset-0 bg-green-100 opacity-40"
                    style={{
                      clipPath: 'polygon(15% 0%, 85% 0%, 90% 10%, 95% 25%, 92% 40%, 88% 55%, 85% 70%, 80% 85%, 75% 95%, 25% 100%, 20% 90%, 15% 75%, 12% 60%, 10% 45%, 8% 30%, 12% 15%)'
                    }}
                  ></div>

                  {/* Water Bodies - Mactan Channel (East) and Bohol Strait (West) */}
                  <div className="absolute right-0 top-0 bottom-0 w-24 bg-blue-300 opacity-40"></div>
                  <div className="absolute left-0 top-0 bottom-0 w-20 bg-blue-300 opacity-35"></div>
                  
                  {/* Mactan Island - Across the channel */}
                  <div 
                    className="absolute right-4 top-1/4 bottom-1/4 w-12 bg-green-200 opacity-60 rounded-lg"
                  ></div>

                  {/* ACCURATE ROAD NETWORK - Based on real Cebu geography */}
                  
                  {/* N. Bacalso Avenue / South Road Properties - Main North-South Artery (West) */}
                  <div className="absolute left-1/4 top-0 bottom-0 w-0.5 bg-red-500 opacity-80"></div>
                  
                  {/* Osmeña Boulevard - Central North-South Road */}
                  <div className="absolute left-2/5 top-1/6 bottom-1/6 w-1 bg-yellow-600 opacity-90"></div>
                  
                  {/* V. Rama Avenue - Eastern North-South Road */}
                  <div className="absolute left-3/5 top-1/8 bottom-1/4 w-0.5 bg-yellow-500 opacity-80"></div>
                  
                  {/* Colon Street - Historic East-West Downtown Road */}
                  <div className="absolute bottom-2/5 left-1/4 right-2/5 h-1 bg-orange-600 opacity-90"></div>
                  
                  {/* Fuente Circle to Lahug Road - Diagonal Northeast */}
                  <div 
                    className="absolute bottom-1/3 left-2/5 w-1/4 h-0.5 bg-yellow-500 opacity-80 transform rotate-45"
                  ></div>
                  
                  {/* Banilad Road - To IT Park */}
                  <div 
                    className="absolute top-1/3 left-1/2 w-1/4 h-0.5 bg-yellow-400 opacity-80 transform rotate-30"
                  ></div>

                  {/* ACCURATE LANDMARK POSITIONING */}
                  
                  {/* Downtown Cebu - Historic Center (South-Central) */}
                  <div className="absolute bottom-2/5 left-1/3 w-16 h-12 bg-orange-200 opacity-60 rounded border border-orange-400"></div>
                  
                  {/* Fuente Circle Area - Central Business */}
                  <div className="absolute bottom-1/3 left-2/5 w-8 h-8 bg-yellow-300 opacity-60 rounded-full border border-yellow-500"></div>
                  
                  {/* Capitol Site - Government District (Central) */}
                  <div className="absolute top-1/2 left-2/5 w-12 h-8 bg-gray-300 opacity-70 rounded border border-gray-500"></div>
                  
                  {/* Lahug District - Uptown (North-Central) */}
                  <div className="absolute top-1/4 left-1/2 w-20 h-14 bg-purple-200 opacity-50 rounded border border-purple-400"></div>
                  
                  {/* IT Park - Apas/Lahug (North-East) */}
                  <div className="absolute top-1/4 right-1/3 w-14 h-10 bg-blue-400 opacity-70 rounded border-2 border-blue-600"></div>
                  
                  {/* Ayala Business Park - Cebu Business Park (East-Central) */}
                  <div className="absolute top-2/5 right-1/4 w-12 h-10 bg-red-400 opacity-70 rounded border-2 border-red-600"></div>
                  
                  {/* SM City Cebu - North Reclamation Area */}
                  <div className="absolute top-1/3 left-1/3 w-10 h-8 bg-blue-300 opacity-70 rounded border border-blue-500"></div>
                  
                  {/* University Belt - USC Main Campus (Downtown) */}
                  <div className="absolute bottom-1/4 left-1/3 w-8 h-6 bg-green-400 opacity-70 rounded border border-green-600"></div>

                  {/* ACCURATE GEOGRAPHIC LABELS */}
                  <div className="absolute top-6 left-1/2 text-xs font-bold text-purple-900 bg-white bg-opacity-95 px-2 py-1 rounded shadow border">
                    Lahug
                  </div>
                  <div className="absolute top-1/4 right-1/4 text-xs font-bold text-blue-900 bg-white bg-opacity-95 px-2 py-1 rounded shadow border">
                    IT Park
                  </div>
                  <div className="absolute top-2/5 right-1/6 text-xs font-bold text-red-900 bg-white bg-opacity-95 px-2 py-1 rounded shadow border">
                    Ayala CBD
                  </div>
                  <div className="absolute bottom-2/5 left-1/4 text-xs font-bold text-orange-900 bg-white bg-opacity-95 px-2 py-1 rounded shadow border">
                    Downtown
                  </div>
                  <div className="absolute bottom-1/3 left-1/3 text-xs font-bold text-yellow-800 bg-white bg-opacity-95 px-2 py-1 rounded shadow border">
                    Fuente
                  </div>
                  <div className="absolute top-1/2 left-1/3 text-xs font-bold text-gray-800 bg-white bg-opacity-95 px-2 py-1 rounded shadow border">
                    Capitol
                  </div>
                  <div className="absolute top-1/3 left-1/4 text-xs font-bold text-blue-800 bg-white bg-opacity-95 px-2 py-1 rounded shadow border">
                    SM Cebu
                  </div>
                  <div className="absolute bottom-1/4 left-1/4 text-xs font-bold text-green-800 bg-white bg-opacity-95 px-2 py-1 rounded shadow border">
                    USC
                  </div>
                  <div className="absolute right-6 top-1/2 text-xs font-bold text-green-700 bg-white bg-opacity-95 px-2 py-1 rounded shadow border">
                    Mactan Island
                  </div>

                  {/* Geographic Orientation Indicator */}
                  <div className="absolute top-2 right-2 bg-white bg-opacity-90 p-2 rounded shadow border">
                    <div className="text-xs font-bold text-gray-800 mb-1">N</div>
                    <div className="w-4 h-4 border-2 border-gray-600 border-t-red-500 rounded-full"></div>
                  </div>
                </div>

                {/* Map Center Crosshair */}
                <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2">
                  <div className="w-8 h-8 border-2 border-gray-400 rounded-full bg-white bg-opacity-80 flex items-center justify-center">
                    <div className="w-2 h-2 bg-gray-600 rounded-full"></div>
                  </div>
                </div>

                {/* Selected Location Marker */}
                {selectedCoordinates && (
                  <div 
                    className="absolute transform -translate-x-1/2 -translate-y-full"
                    style={{
                      left: '50%',
                      top: '50%'
                    }}
                  >
                    <div className="relative">
                      <svg className="h-8 w-8 text-red-500 drop-shadow-lg" fill="currentColor" viewBox="0 0 24 24">
                        <path d="M12 2C8.13 2 5 5.13 5 9c0 5.25 7 13 7 13s7-7.75 7-13c0-3.87-3.13-7-7-7zm0 9.5c-1.38 0-2.5-1.12-2.5-2.5s1.12-2.5 2.5-2.5 2.5 1.12 2.5 2.5-1.12 2.5-2.5 2.5z"/>
                      </svg>
                      <div className="absolute -bottom-1 left-1/2 transform -translate-x-1/2 w-2 h-2 bg-red-500 rounded-full animate-pulse"></div>
                    </div>
                  </div>
                )}

                {/* Map Labels */}
                <div className="absolute top-4 left-4 bg-white bg-opacity-90 px-3 py-2 rounded-lg shadow-sm">
                  <div className="text-sm font-semibold text-gray-700">Cebu Area</div>
                  <div className="text-xs text-gray-500">Click anywhere to select location</div>
                </div>

                {/* Zoom Controls */}
                <div className="absolute top-4 right-4 flex flex-col space-y-2">
                  <button className="w-10 h-10 bg-white hover:bg-gray-50 border border-gray-300 rounded-lg shadow-sm flex items-center justify-center transition-colors">
                    <svg className="h-5 w-5 text-gray-600" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 6v6m0 0v6m0-6h6m-6 0H6" />
                    </svg>
                  </button>
                  <button className="w-10 h-10 bg-white hover:bg-gray-50 border border-gray-300 rounded-lg shadow-sm flex items-center justify-center transition-colors">
                    <svg className="h-5 w-5 text-gray-600" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M20 12H4" />
                    </svg>
                  </button>
                </div>

                {/* Current Location Button */}
                <button
                  onClick={getCurrentLocation}
                  className="absolute bottom-4 right-4 w-12 h-12 bg-blue-600 hover:bg-blue-700 text-white rounded-full shadow-lg flex items-center justify-center transition-colors"
                  title="Get Current Location"
                >
                  <svg className="h-6 w-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 19l9 2-9-18-9 18 9-2zm0 0v-8" />
                  </svg>
                </button>
              </div>

              {/* Location Info Panel */}
              <div className="bg-gray-50 border-t border-gray-200 p-4">
                <div className="flex items-center justify-between">
                  <div className="flex-1">
                    {selectedCoordinates ? (
                      <div>
                        <div className="text-sm font-semibold text-gray-900">Selected Location</div>
                        <div className="text-sm text-gray-600">
                          Coordinates: {selectedCoordinates[0].toFixed(6)}, {selectedCoordinates[1].toFixed(6)}
                        </div>
                        <div className="text-xs text-gray-500 mt-1">
                          Click "Confirm Location" to use this position for your search
                        </div>
                      </div>
                    ) : (
                      <div>
                        <div className="text-sm font-semibold text-gray-900">Click on the map</div>
                        <div className="text-sm text-gray-600">Select your preferred location by clicking anywhere on the map</div>
                      </div>
                    )}
                  </div>
                  
                  {selectedCoordinates && (
                    <button
                      onClick={confirmMapLocation}
                      className="ml-4 px-6 py-2 bg-blue-600 hover:bg-blue-700 text-white rounded-lg font-medium transition-colors shadow-sm"
                    >
                      Confirm Location
                    </button>
                  )}
                </div>
              </div>

              {/* Quick Location Shortcuts */}
              <div className="bg-white border-t border-gray-200 p-4">
                <div className="text-sm font-semibold text-gray-700 mb-3">Quick Locations</div>
                <div className="flex flex-wrap gap-2">
                  {locations.slice(1).map((location) => (
                    <button
                      key={location.value}
                      onClick={() => {
                        // Set predefined coordinates for known locations
                        const coords = getLocationCoordinates(location.value);
                        setSelectedCoordinates(coords);
                        setMapCenter(coords);
                      }}
                      className="px-3 py-1 text-sm bg-gray-100 hover:bg-gray-200 text-gray-700 rounded-full transition-colors"
                    >
                      {location.label}
                    </button>
                  ))}
                </div>
              </div>
            </div>
          </div>
        </div>
      )}
      </div>
  );
};

export default SearchSection;
